B.CN=new A.aO("text",'<li><b><code>ListView</code> y <code>GridView</code>:</b> Para crear listas o rejillas de elementos que se pueden desplazar. Tambi\xe9n usan la propiedad <code>children</code>.</li>\n<li><b><code>Text</code>:</b> El widget m\xe1s b\xe1sico para mostrar texto. Su atributo m\xe1s usado es <code>style</code> para cambiar la apariencia (color, tama\xf1o, etc.).</li>\n<li><b><code>Card</code>:</b> Envuelve a otro widget para darle una apariencia de "tarjeta" con bordes redondeados y una sombra. Sus atributos principales son <code>child</code> y <code>elevation</code> (para la sombra).</li>\n<li><b><code>ListTile</code>:</b> Un widget muy \xfatil para crear filas en una lista. Viene preparado con espacios para un <code>leading</code> (\xedcono al inicio), <code>title</code>, <code>subtitle</code> y un <code>trailing</code> (\xedcono al final).</li>\n<li><b><code>Divider</code> y <code>VerticalDivider</code>:</b> L\xedneas simples para separar visualmente otros widgets. Puedes cambiar su <code>color</code> y <code>thickness</code> (grosor).</li>\n',null)
B.CO=new A.aO("text",'<li><b><code>StatefulWidget</code> (Widget Din\xe1mico):</b> Es como un interruptor de luz. Puede cambiar su "estado" (su memoria interna). Lo usamos para cosas que deben reaccionar a la interacci\xf3n, como un contador que aumenta o un campo de texto que guarda lo que escribes. Para actualizar la pantalla, usamos el m\xe9todo <code>setState()</code>. Su estructura base es: <code>class MiWidget extends StatefulWidget { ... }</code></li>\n',null)
B.CP=new A.aO("text","<b>Widgets Est\xe1ticos vs. Din\xe1micos</b>\n<p>Hay dos tipos principales de widgets que usar\xe1s constantemente.</p>\n<li><b><code>StatelessWidget</code> (Widget Est\xe1tico):</b> Es como una foto. Una vez que lo creas, no cambia. Es perfecto para t\xedtulos, \xedconos o cualquier elemento que no necesite interactuar con el usuario. Su estructura base es: <code>class MiWidget extends StatelessWidget { ... }</code></li>\n",null)
B.CQ=new A.aO("text","<li><b><code>bool</code>:</b> Cajas que solo guardan 'verdadero' (<code>true</code>) o 'falso' (<code>false</code>). Por ejemplo: <code>bool esDeDia = true;</code></li>\n",null)
B.CR=new A.aO("text",'<b>Paso 1: Presentar el "Plano" - El Prompt Estructurado</b>\n<p>Comenzamos con nuestro prompt detallado para una app de lista de tareas. Repasamos cada secci\xf3n (Contexto, Funcionalidad, Estructura) para asegurarnos de que la IA entienda exactamente lo que queremos construir.</p>\n',null)
B.CS=new A.aO("text",'<b>Paso 1: Estructura del Proyecto y Modelos de Datos</b>\n<p>Antes de escribir la interfaz, un buen desarrollador organiza su proyecto. Crearemos carpetas para mantener todo en orden: <code>models</code> para nuestras plantillas de datos, <code>screens</code> para cada pantalla de la app, y <code>services</code> para la l\xf3gica de negocio.</p>\n<li><b>Modelo de Datos:</b> Crearemos una clase <code>Task</code> en <code>task_model.dart</code>. Este ser\xe1 el "plano" para cada tarea, definiendo qu\xe9 informaci\xf3n debe tener: un ID, un t\xedtulo y un estado de completado.</li>\n',null)
B.CT=new A.aO("text","<li><b><code>Container</code>:</b> Es una caja vers\xe1til que puedes usar para decorar otros widgets. Sus atributos clave son <code>child</code>, <code>color</code>, <code>padding</code> (espacio interior) y <code>margin</code> (espacio exterior).</li>\n<li><b><code>Column</code> y <code>Row</code>:</b> Son para organizar widgets en vertical y horizontal. Su atributo m\xe1s importante es <code>children</code>, que es una lista de los widgets que contendr\xe1n.</li>\n",null)
