B.CV=new A.aO("text",'<b>Ejemplo de un Prompt Estructurado</b>\n<p>Para guiar a la IA de manera efectiva, un buen prompt debe tener una estructura clara. Aqu\xed tienes un ejemplo para una app de lista de tareas:</p>\n<li><b>1. Contexto:</b> "App de tareas para estudiantes que buscan una herramienta minimalista y f\xe1cil de usar."</li>\n<li><b>2. Funcionalidad:</b> "El usuario podr\xe1 a\xf1adir, editar, marcar como completada y eliminar tareas. Las tareas completadas deben aparecer tachadas."</li>\n<li><b>3. Estructura (Widgets):</b> "La pantalla principal ser\xe1 un <code>Scaffold</code> con un <code>ListView.builder</code> en el <code>body</code> y un <code>FloatingActionButton</code> para a\xf1adir tareas."</li>\n<li><b>4. Consideraciones Adicionales:</b> "Usar dise\xf1o Material 3. El manejo de estado debe ser con Provider."</li>\n',null)
