B.D4=new A.aO("text","<b>IA en el Ciclo de Desarrollo de Software</b>\n<p>La Inteligencia Artificial (IA) ya no es solo para generar ideas; es un asistente poderoso en cada etapa del desarrollo. La IA generativa y los modelos de lenguaje grandes (LLM) pueden automatizar tareas, desde analizar requisitos hasta generar c\xf3digo y casos de prueba.</p>\n<li><b>Dise\xf1o y Planificaci\xf3n:</b> La IA puede sugerir arquitecturas de software, dise\xf1os de interfaz de usuario (UI/UX) y generar maquetas basadas en tus descripciones.</li>\n<li><b>Desarrollo:</b> Herramientas como GitHub Copilot pueden autocompletar tu c\xf3digo, generar funciones enteras a partir de un comentario y ayudarte a detectar errores m\xe1s r\xe1pido.</li>\n",null)
B.D5=new A.aO("text","<b>Organizando Datos: Colecciones</b>\n<p>\xbfY si queremos guardar varias cosas juntas? Usamos colecciones.</p>\n<li><b>Listas (<code>List</code>):</b> Como una lista de compras. Es una colecci\xf3n ordenada de elementos. <code>List<String> compras = ['Leche', 'Pan'];</code></li>\n",null)
B.D6=new A.aO("image","assets/images/module_3_design_thinking_process.png",null)
B.D7=new A.aO("image","assets/images/module_4_prompt_structure.png",null)
B.D8=new A.aO("text",'<b>Las 5 Etapas del Proceso</b>\n<p>El Design Thinking se divide en 5 fases que te gu\xedan desde el problema hasta la soluci\xf3n.</p>\n<li><b>1. Empatizar:</b> La primera fase es "ponerse en los zapatos del otro". El objetivo es comprender verdaderamente a los usuarios, sus necesidades, deseos y frustraciones. Se usan t\xe9cnicas como entrevistas o el "mapa de empat\xeda".</li>\n<li><b>2. Definir:</b> Despu\xe9s de entender al usuario, sintetizas toda la informaci\xf3n para definir claramente cu\xe1l es el problema principal que vas a resolver.</li>\n<li><b>3. Idear:</b> \xa1Aqu\xed es donde ocurre la magia! Es una lluvia de ideas sin l\xedmites para generar la mayor cantidad de soluciones posibles, sin juzgar si son buenas o malas.</li>\n<li><b>4. Prototipar:</b> Transformas tus mejores ideas en versiones simples y tangibles. Puede ser un simple dibujo en papel o una maqueta interactiva. El objetivo es crear algo que los usuarios puedan probar.</li>\n<li><b>5. Testear:</b> Pones tus prototipos en manos de usuarios reales para obtener su opini\xf3n. Esta retroalimentaci\xf3n es oro puro para saber qu\xe9 funciona, qu\xe9 no, y c\xf3mo mejorar tu soluci\xf3n.</li>\n',null)
B.D9=new A.aO("text",'<b>Paso 4: La Colaboraci\xf3n - Depuraci\xf3n Asistida por IA</b>\n<p>Tomamos el primer error de la consola, lo copiamos y le pedimos a la IA que nos ayude a solucionarlo con un nuevo prompt como: "El c\xf3digo que me diste me da este error: [pegar error]. \xbfC\xf3mo lo soluciono?". Aplicamos la correcci\xf3n y repetimos el proceso.</p>\n',null)
B.Da=new A.aO("text","<b>Paso 6: Conclusi\xf3n y Reflexi\xf3n</b>\n<p>Al final, tenemos una aplicaci\xf3n funcional. Comparamos el c\xf3digo final con el primer borrador de la IA. La lecci\xf3n clave es que la IA es un copiloto incre\xedblemente potente, pero el desarrollador sigue siendo el piloto que define la direcci\xf3n y toma las decisiones finales.</p>\n",null)
