B.Dk=new A.aO("text",'<b>\xbfQu\xe9 es el Design Thinking?</b>\n<p>Antes de escribir una sola l\xednea de c\xf3digo, los mejores desarrolladores se preguntan: "\xbfQu\xe9 problema estoy resolviendo y para qui\xe9n?". El Design Thinking es una metodolog\xeda para responder a esa pregunta. Es una forma de trabajar en grupo que maximiza la creatividad para encontrar soluciones que la gente realmente quiera usar.</p>\n<li><b>Centrado en la Persona:</b> El coraz\xf3n de esta metodolog\xeda es entender profundamente a las personas. Si no dise\xf1as para ellas, tu app no tendr\xe1 \xe9xito.</li>\n<li><b>Iterativo y Experimental:</b> No es un camino recto. Es un ciclo de probar, fallar, aprender y mejorar. Los errores son oportunidades para aprender.</li>\n<li><b>Colaborativo:</b> Se basa en el trabajo en equipo, donde personas con diferentes puntos de vista aportan ideas para crear una soluci\xf3n m\xe1s completa.</li>\n',null)
