B.Dp=new A.aO("text",'<b>Paso 2: Gesti\xf3n de Estado con Provider</b>\n<p>Nuestra app necesita "recordar" la lista de tareas, incluso si cambiamos de pantalla. Usar <code>setState()</code> para esto ser\xeda complicado. En su lugar, usaremos un gestor de estado.</p>\n<li><b>Provider:</b> A\xf1adiremos el paquete <code>provider</code> a nuestro proyecto. Este actuar\xe1 como una fuente central de informaci\xf3n. Crearemos una clase <code>TaskProvider</code> que se encargar\xe1 de manejar la lista de tareas (a\xf1adir, eliminar, etc.).</li>\n',null)
B.Dq=new A.aO("text","<b>Paso 2: La Primera Interacci\xf3n - Generar el C\xf3digo Base</b>\n<p>Abrimos una herramienta de IA generativa (como Gemini o ChatGPT) y pegamos nuestro prompt completo. Le pedimos que genere el c\xf3digo inicial para nuestra aplicaci\xf3n en Flutter.</p>\n",null)
B.Dr=new A.aO("text",'<b>Paso 4: Persistencia y Despliegue</b>\n<p>\xa1No queremos que nuestras tareas desaparezcan al cerrar la app! Para ello, usaremos persistencia de datos.</p>\n<li><b>Persistencia de Datos:</b> Usaremos el paquete <code>shared_preferences</code> para guardar la lista de tareas en la memoria del dispositivo. As\xed, la pr\xf3xima vez que el usuario abra la app, sus tareas seguir\xe1n ah\xed.</li>\n<li><b>Pruebas y Despliegue:</b> Finalmente, aprender\xe1s a escribir una "prueba unitaria" simple para verificar que tu l\xf3gica funciona correctamente y los pasos b\xe1sicos para compilar tu aplicaci\xf3n para la web con <code>flutter build web</code>.</li>\n',null)
B.Ds=new A.aO("text",'<b>Ingenier\xeda de Prompts: Hablando con la IA</b>\n<p>La Ingenier\xeda de Prompts es el arte de dise\xf1ar instrucciones (prompts) claras y efectivas para que los modelos de IA generen exactamente lo que necesitas. Es una habilidad clave para cualquier desarrollador moderno.</p>\n<li><b>Claridad y Especificidad:</b> Un buen prompt es detallado. En lugar de pedir "c\xf3digo para un bot\xf3n", pide "c\xf3digo en Flutter para un ElevatedButton azul, con texto \'Aceptar\' en blanco y bordes redondeados".</li>\n<li><b>Iteraci\xf3n y Verificaci\xf3n:</b> El primer resultado de la IA no siempre es perfecto. Es un proceso de experimentar, refinar tu prompt y siempre revisar cr\xedticamente el c\xf3digo generado. \xa1La IA puede cometer errores!</li>\n',null)
B.Dt=new A.aO("image","assets/images/module_5_provider_flow.png",null)
B.Du=new A.aO("text",'<li><b><code>var</code>:</b> A veces, no quieres especificar el tipo y prefieres que Dart lo adivine por ti. Para eso usas <code>var</code>. Dart mirar\xe1 el valor que le asignas y decidir\xe1 el tipo. Por ejemplo: <code>var mensaje = "qwer";</code> (Dart sabe que es un String).</li>\n',null)
B.Dv=new A.aO("text","<b>\xa1Bienvenido al mundo de la programaci\xf3n!</b>\n<p>Imagina que quieres darle instrucciones a una computadora. No puedes hablarle como a una persona; necesitas un idioma especial. Eso es un lenguaje de programaci\xf3n. En este curso, aprender\xe1s <b>Dart</b>, el lenguaje que usa Flutter para crear apps incre\xedbles.</p>\n",null)
B.Dw=new A.aO("text","<li><b>Mapas (<code>Map</code>):</b> Como una agenda. Guardas un valor (el n\xfamero de tel\xe9fono) asociado a una clave \xfanica (el nombre). <code>Map<String, int> edades = {'Ana': 25};</code></li>\n",null)
B.Dx=new A.aO("image","assets/images/module_5_deployment.png",null)
B.Dy=new A.aO("text","<b>Tomando Decisiones: Control de Flujo</b>\n<p>A veces, queremos que nuestro programa haga una cosa u otra dependiendo de una condici\xf3n. Para eso usamos <code>if</code> (si) y <code>else</code> (si no). Se basa en operadores de comparaci\xf3n como <code>></code> (mayor que), <code><</code> (menor que) o <code>==</code> (igual que).</p>\n<li><b>Ejemplo:</b> <code>if (miEdad >= 18) { print('Eres mayor de edad'); } else { print('Eres menor de edad'); }</code>. Esto es como decir: \"Si la edad en la caja es mayor o igual a 18, di una cosa. Si no, di otra\".</li>\n",null)
