B.Dz=new A.nb("Actividad Pr\xe1ctica: Tu Primer Copiloto de IA","Utilizar una herramienta de IA para generar un widget de Flutter a partir de un prompt detallado.","GitHub Copilot (en VS Code), o un LLM como Gemini o ChatGPT.","<li><b>1. Define el Requisito:</b> Quieres crear una \"Tarjeta de Pel\xedcula\" para una app. Debe mostrar un t\xedtulo, el a\xf1o de estreno y un p\xf3ster.</li>\n<li><b>2. Escribe el Prompt:</b> En un archivo Dart, escribe un comentario detallado (un prompt) que describa el widget. Por ejemplo: <code>// Crea un StatelessWidget en Flutter llamado 'MovieCard'. Debe recibir un t\xedtulo (String), un a\xf1o (String) y una URL de p\xf3ster (String). Debe mostrar el p\xf3ster usando Image.network, y debajo, el t\xedtulo en negrita y el a\xf1o en un texto m\xe1s peque\xf1o.</code></li>\n<li><b>3. Genera y Analiza:</b> Usa tu herramienta de IA para generar el c\xf3digo a partir del comentario.</li>\n<li><b>4. Refina el C\xf3digo:</b> Revisa el c\xf3digo generado. \xbfEs correcto? \xbfPodr\xedas mejorarlo? Haz los ajustes necesarios para que funcione en tu aplicaci\xf3n.</li>\n")
B.DA=new A.nb("Actividades Pr\xe1cticas del M\xf3dulo 2","Construir tus primeras interfaces de usuario en Flutter, utilizando widgets est\xe1ticos y din\xe1micos.",u.p,'<li><b>1. Tarjeta de Presentaci\xf3n (Stateless):</b> Crea una pantalla que muestre tu nombre, profesi\xf3n y una imagen de perfil. Organiza los elementos usando <code>Column</code>, <code>Row</code> y <code>Container</code>.</li>\n<li><b>2. Contador Interactivo (Stateful):</b> Implementa una pantalla con un n\xfamero y dos botones. Un bot\xf3n debe incrementar el n\xfamero y el otro debe reiniciarlo a cero. Usa <code>StatefulWidget</code> y <code>setState()</code>.</li>\n<li><b>3. Modularizaci\xf3n:</b> Extrae la "Tarjeta de Presentaci\xf3n" del paso 1 a su propio archivo y clase (un widget personalizado). Luego, imp\xf3rtala y \xfasala en tu pantalla principal.</li>\n')
B.DB=new A.nb('Actividad: "Mi Perfil de Programador Dart"','Crear un programa simple en Dart que defina caracter\xedsticas de un "programador", realice algunas operaciones y clasifique su perfil bas\xe1ndose en estas.',"DartPad (https://dartpad.dev/)",'<li><b>1. Prepara tu entorno en DartPad:</b> Abre dartpad.dev y selecciona "New Pad" de tipo Dart.</li>\n<li><b>2. Define tus "Datos de Programador":</b> Dentro de <code>void main()</code>, declara variables como <code>nombre</code> (String), <code>aniosExperiencia</code> (int), <code>calificacionPromedio</code> (double), y <code>leGustaFlutter</code> (bool).</li>\n<li><b>3. Realiza Operaciones:</b> Usa <code>print()</code> para mostrar la informaci\xf3n usando interpolaci\xf3n de cadenas (<code>$variable</code>). Realiza una operaci\xf3n aritm\xe9tica simple y usa un operador de incremento/decremento.</li>\n<li><b>4. Clasifica el Perfil:</b> Usa <code>if/else</code> para clasificar el nivel de experiencia y un <code>switch</code> para dar un mensaje basado en una variable <code>lenguajeFavorito</code>.</li>\n<li><b>5. Ejecuta y Experimenta:</b> Haz clic en "Run" y observa los resultados. Modifica los valores de tus variables y vuelve a ejecutar para ver c\xf3mo cambian los mensajes.</li>\n')
B.DC=new A.nb("Actividad Pr\xe1ctica: De la Idea al Prompt","Aplicar las fases del Design Thinking para generar la base de un prompt de IA.","Papel, bol\xedgrafo, o una herramienta de pizarra digital.",'<li><b>1. Empatizar y Definir (Contexto):</b> Elige un problema simple (ej. "es dif\xedcil decidir qu\xe9 pel\xedcula ver"). Entrevista a 2-3 personas sobre \xe9l. Sintetiza tus hallazgos para definir para qui\xe9n es la app y qu\xe9 problema resuelve. <i>Esto ser\xe1 tu <b>Contexto</b>.</i></li>\n<li><b>2. Idear (Funcionalidad):</b> Haz una lluvia de ideas sobre las acciones que el usuario podr\xe1 realizar. Selecciona las m\xe1s importantes. <i>Esta ser\xe1 tu <b>Funcionalidad</b>.</i></li>\n<li><b>3. Prototipar (Estructura):</b> Dibuja en papel las pantallas principales de tu app. Piensa en los widgets clave que usar\xedas (botones, listas, etc.). <i>Esta ser\xe1 tu <b>Estructura</b>.</i></li>\n<li><b>4. Definir el Estilo:</b> Piensa en la apariencia de tu app (minimalista, colorida, profesional). Elige una paleta de colores b\xe1sica. <i>Este ser\xe1 tu <b>Estilo</b>.</i></li>\n<li><b>5. Construir la Base del Prompt:</b> Junta todo. En un documento, escribe los cuatro encabezados (Contexto, Funcionalidad, Estructura, Estilo) y resume debajo de cada uno lo que definiste. \xa1Has creado la base perfecta para un prompt de IA!</li>\n')
B.DD=new A.nb("Actividad Pr\xe1ctica: App de Lista de Tareas","Crear una aplicaci\xf3n completa que gestione estado, consuma una API simulada y siga buenas pr\xe1cticas de estructura.",u.p,'<li><b>1. Estructura del Proyecto:</b> Organiza tu app en carpetas para modelos, vistas (pantallas) y servicios (l\xf3gica de API).</li>\n<li><b>2. Gesti\xf3n de Estado:</b> Elige un gestor de estado (como Provider) para manejar la lista de tareas. Debes poder a\xf1adir, eliminar y marcar tareas como completadas.</li>\n<li><b>3. Consumo de API (Simulado):</b> Usa <code>Future.delayed</code> para simular una llamada de red que "carga" las tareas iniciales al abrir la app. Muestra un indicador de carga mientras esperas.</li>\n<li><b>4. Pruebas Unitarias:</b> Escribe una prueba unitaria simple para tu l\xf3gica de gesti\xf3n de estado. Por ejemplo, verifica que al llamar a la funci\xf3n `addTask`, la longitud de la lista de tareas realmente aumenta en uno.</li>\n')
